import React from "react";
import Navbar from "./sections/navbar/Navbar";
import Services from "./sections/services copy/Services";
import Portfolio from "./sections/portfolio copy/Portfolio";
import Contact from "./sections/footer copy/Footer";

const App = () => {
	return (
		<>
			<Navbar />
			<Header />
			<About />
			<Services />
			<Portfolio />
			<Testimonials />
			<Faqs />
			<Contact />
			<Footer />
			<FloatingNav />
		</>
	);
};

export default App;
